import React, {fragment} from 'react';

import Inputtodo from './components/Inputtodo';
import ListTodos from './components/listtodo';

import './App.css';


function App() {
  return(
    <fragment>
      <div className='container'>
        <Inputtodo/>
        <Listtodo/>
        </div>
        </fragment>
   ) ;
}

export default App;
